import React from 'react';
import AppLayout from '../components/Applayout';
import postForm from '../components/postForm';
import postList from '../components/postList';

const FreeBoard = () => {
  return (
    <>
      <AppLayout>
        <postForm />
      </AppLayout>
    </>
  );
};

export default FreeBoard;
